PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?company ?website WHERE {
  ?company wdt:P31 wd:Q4830453 ; wdt:P1128 ?employees ; wdt:P856 ?website .
  FILTER ( ?employees > 500000 )
}

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT ?person ?personLabel ?occupationLabel WHERE {
  ?person wdt:P31 wd:Q5 ; wdt:P106 wd:Q12634815 .
  OPTIONAL {
    ?person rdfs:label ?personLabel FILTER ( LANG( ?personLabel ) = "en" )
  }
  .
  OPTIONAL {
    wd:Q12634815 rdfs:label ?occupationLabel FILTER ( LANG( ?occupationLabel ) = "en" )
  }
}

