PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?capital WHERE {
  wd:Q79 wdt:P36 ?capital .
  ?capital wdt:P1082 ?pop .
  FILTER ( ISNUMERIC( ?pop ) ) .
  {
    SELECT ?city WHERE {
      ?city wdt:P31 wd:Q515 ; wdt:P17 wd:Q79 ; wdt:P1082 ?p .
      FILTER ( ISNUMERIC( ?p ) )
    }
    ORDER BY DESC ( ?p )
    LIMIT 1
  }
  FILTER ( ?capital = ?city )
}

