SELECT ?actor ?birthDate WHERE {
  wd:Q162371 wdt:P161 ?actor .
  ?actor wdt:P31 wd:Q5 .
  ?actor wdt:P569 ?birthDate .
  OPTIONAL {
    ?actor rdfs:label ?actorLabel .
    FILTER ( LANG( ?actorLabel ) = "en" )
  }
}
ORDER BY ?actorLabel

